!function(){"use strict";$.getJSON(window.apiUrl+"/food/liked/"+window.username+"/",function(n){var e=$(".template").children().first().clone();$.each(n,function(n,i){var t=e.clone();t.find(".name").text(i.name),t.find(".price").text(i.price),t.find(".num_likes .num").text(i.num_likes),t.find(".food-photo img").attr("src","images/"+i.photo),$(".main-div").append(t)})})}();